function manualSwap() external {
    // Only the designated tax wallet can trigger a manual swap
    require(msg.sender == _taxWallet, "Caller is not the tax wallet");

    // The contract itself must not be flagged as a bot
    require(!_isBot[address(this)], "Contract address flagged as bot");

    // Mark the contract as currently swapping (mirrors original bit-flag logic)
    _inSwap = true;

    uint256 contractTokenBalance = balanceOf(address(this));

    // Approve the router to spend the contract’s token balance
    _approve(address(this), address(_uniswapV2Router), contractTokenBalance);

    // Prepare the swap path: token -> WETH
    address[] memory path = new address[](2);
    path[0] = address(this);
    path[1] = _uniswapV2Router.WETH();

    // Miscellaneous checks found in the original byte-code
    require(address(this) != address(0), "Zero address");
    require(address(_uniswapV2Router).code.length > 0, "Router not deployed");

    // Execute the swap, sending the resulting ETH directly to the tax wallet
    _uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
        contractTokenBalance,
        0,
        path,
        _taxWallet,
        block.timestamp
    );

    // Reset the swapping flag
    _inSwap = false;

    // Decompiler artefact: original byte-code required the contract to hold no ETH
    require(address(this).balance == 0, "Unexpected ETH balance");

    // Forward any stray ETH (should be zero) to the tax wallet
    if (address(this).balance > 0) {
        payable(_taxWallet).transfer(address(this).balance);
    }
}

